        private void convertToImage(object sender, RoutedEventArgs e)
        {
            var base64String = tbBase64StringBox.Text;
            var bitmap = GetImageFromBase64(base64String);
            image.Source = bitmap;
        }

        BitmapImage GetImageFromBase64(string text)
        {
            byte[] binaryData = Convert.FromBase64String(text);

            BitmapImage bi = new BitmapImage();
            bi.BeginInit();
            bi.StreamSource = new MemoryStream(binaryData);
            bi.EndInit();

            return bi;
        }

        public string BitmapToBase64(BitmapImage bi)
        {   
            MemoryStream ms = new MemoryStream();
            PngBitmapEncoder encoder = new PngBitmapEncoder();
            encoder.Frames.Add(BitmapFrame.Create(bi));
            encoder.Save(ms);
            byte[] bitmapdata = ms.ToArray();

            return Convert.ToBase64String(bitmapdata);
        }

        private void convertToString(object sender, RoutedEventArgs e)
        {
            Microsoft.Win32.OpenFileDialog dlg = new Microsoft.Win32.OpenFileDialog();

            dlg.DefaultExt = ".bmp";
            dlg.Filter = "JPEG Files (*.jpeg)|*.jpeg|PNG Files (*.png)|*.png|JPG Files (*.jpg)|*.jpg|GIF Files (*.gif)|*.gif|BMP Files (*.bmp)|*.bmp";

            Nullable<bool> result = dlg.ShowDialog();

            if (result == true)
            {
                string filename = dlg.FileName;
                FileStream stream = File.OpenRead(filename);
                BitmapImage bitmap = new BitmapImage();

                bitmap.BeginInit();
                bitmap.StreamSource = stream;
                bitmap.CacheOption = BitmapCacheOption.OnLoad;
                bitmap.EndInit();
                bitmap.Freeze();

                var base64String = BitmapToBase64(bitmap);
                image.Source = bitmap;
                tbBase64StringBox.Text = base64String;
            }
            else
            {
                MessageBox.Show("No File selected");
            }
        }
    }
}
